Independent Division of Xinjiang Military District (Chinese: 新疆军区独立师)(1st Formation) was formed in July 1966 from the Public Security Contingent of Xinjiang Uyghur Autonomous Region. The separation]] was composed of three regiments (1st to 3rd). On February 25, 1969, the division exchanged its designation and position with Independent Division of Qinghai Provincial Military District with all its remaining 3 regiments, and became the second formation of Independent Division of Qinghai Military Municipality]] (Chinese: 青海省军区独立师). All its regiments were renamed as follows: 
* 1st Regiment (former 2nd); 
* 3rd Regiment (former 3rd); 
* 7th Regiment (former 1st). As of October 26th 1970 the divide]] was composed of 7 regiments. In May 1976 the separation]] was disassembled]].

The 9th Reservoir]] Branch]] (Chinese: 坦克第9师) was formed on August 1, 1967 from 236th Tank Self-Propelled Artillery Regiment from 31st Army Division, 239th Aquarium]] Self-Propelled Shells]] Battalions]] from 34th Army Division and 283rd Tank Self-Propelled Artillery Regiment from 179th Army Division. On August 28, 1969, the cleavage]] was composed of: 
* 33rd Aquarium]] Regiment (former 236th Reservoir]] Self-Propelled Artillery Battalion]]); 
* 34th Reservoir]] Expeditionary]] (former 239th Beaker]] Self-Propelled Shells]] Regiment); 
* 35th Aquarium]] Regiment (former 283rd Reservoir]] Self-Propelled Artillery Regiment). The division moved to Changzhi, Shanxi province in November 1969 after its formation to reinforce 27th Army Corps. In the 1970s the division maintained as a reduced tank division, which consisted of 3 under-equipped tank regiments. In January 1976 the subdivision]] was demobilized]]. Its 33rd Tank Regiment became Tank Regiment of 66th Army Corps, 34th Tank Regiment became Tank Regiment of 21st Army Corps and 35th Tank Regiment became Tank Regiment of 28th Army Corps.
